import{AppBar, Toolbar, makeStyles } from '@material-ui/core';
import { NavLinkProps } from 'react-router-dom';

const useStyle = makeStyles({
    header: {
        background: '#111111'
    },
    tabs: {
        color: '#FFFFFF',
        marginRight: 20,
        textDecoration: 'none',
        fontSize: 20
    }
})

const NavBar = () => {
    const classes = useStyle();
    return(
        <AppBar position="static" className={classes.header}>
            <Toolbar>
                <NavLinkProps className={classes.tabs} to="./" exact>Scriptics</NavLinkProps>
                <NavLinkProps className={classes.tabs} to="all" exact>All Users</NavLinkProps>
                <NavLinkProps className={classes.tabs} to="add" exact>Add User</NavLinkProps>
            </Toolbar>
        </AppBar>   
    )
}


export default NavBar;
